import { Link } from "react-router-dom";
import "./Navbar.css"




function Navbar() {
    return (
        <div className="nav">           
            <div className="color"> 
            <h2>Sanaullah</h2>
            <div className="nav-ul">   <Link className="link" to="/">Home</Link>
          <Link className="link" to="/about">About</Link>
          <Link className="link" to="/contact">Contact</Link> </div>

          </div>

        </div>
    )
}

export default Navbar;
